import React from "react";
import "../css/akademii.css";
import data from "../akademii.json";
// import images from "../images";
const AkademiiCards = () => {
  return (
    <div className="academii-crds">
      {data.map((card) => (
        <div
          className="cardAcademii"
          style={{
            backgroundImage: `url(../images/require(${card.image}))`,
            backgroundPosition: "center",
            backgroundSize: "cover",
            borderRadius: "5px",
          }}
        >
          <a href={card.link}>
            {/* <div
              style={{
                backgroundColor: `rgba(${card.bcolor})`,
                width: "100%",
                height: "100%",
                borderRadius: "5px",
                padding: "15px",
              }}
            > */}
            {/* <img src={require(`images.${card.image}.jpg`)}></img> */}
            <h1>{card.title}</h1>
            <p>{card.mesta}</p>
            <p>{card.upisi}</p>
            <p>{card.postani}</p>
            <p>{card.partneri}</p>
            {/* </div> */}
          </a>
        </div>
      ))}
    </div>
  );
};

export default AkademiiCards;
